dedication in writing. Horns representing the miscalculations of others as she fiercely gazes across the horizon, readied to endeavour.\n\nA time for the Evangelists.\nWith path laid out and plans in ink, it\u2019s the duty of the faithful to execute. The peaks and valleys show no reverence across a landscape defined by its malice. Sword in hand to slay machiavellian malevolence and an eye to God for guidance, the voice of struggle stands.\n\nA time for the Crown.\nJewelled crown and gold epaulettes. The cold front, broken, revealing a warmer centre, open to new ideas, understanding and a new way. With love, bravery and un fettering drive, a new reality is to be designed. It\u2019s those who do, who define the future. The coronation, the awakening, the salvation."}}]},"edge_media_to_comment":{"count":235},"comments_disabled":false,"taken_at_timestamp":1613590948,"edge_liked_by":{"count":23839},"edge_media_preview_like":{"count":23839},"location":{"id":"213385402","has_public_page":true,"name":"London, United Kingdom","slug":"london-united-kingdom"},"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/150974239_414705119813515_2355366806329276747_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=AtICrU4fINAAX-SPXF_\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=ef617b35306236ebcd7a2ea71d16c7b4\u0026oe=609490EC\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/150974239_414705119813515_2355366806329276747_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=AtICrU4fINAAX-SPXF_\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=3d7b60942ae3483c37f7cc3c49b0d49f\u0026oe=60952A1C\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s240x240/150974239_414705119813515_2355366806329276747_n
